import React from "react";

function Card() {
  return (
    <div className="card text-center">
      <img class="card-img-top" src="" alt="" />
      <div class="card-body">
        <h4 class="card-title">Title</h4>
        <p class="card-text">Body</p>
      </div>
    </div>
  );
}

export default Card;
